    false,nt"url": null,nt"notes": "This annual narrative report for Flint
    Hills National Wildlife Refuge and Marais Des Cygnes National Wildlife Refuge summarizes
    refuge activities during the 2003 calendar year.  The report begins with a summary
    of the years highlights and climatic conditions. The report includes a planning
    section which discusses management plan, research and investigations, and other.
     Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, safety, and other items is given.  Habitat management
    is also covered.  Subjects include wetlands, forests, cropland, grassland, other
    habitats, grazing, fire management, pest control, and water rights.  The wildlife
    section of the report discusses endangered andor threatened species, waterfowl,
    marsh and water birds, shorebirds, gulls, terns, and allied species, raptors, other
    migratory birds, game mammals, other residents wildlife, and fisheries resources.
     The public uses of the refuge described in this report include general, outdoor
    student and teacher classrooms, interpretive foot trails, interpretive exhibitsdemonstrations,
    hunting, fishing, wildlife observation, other wildlife oriented recreation, camping,
    picnicking, other nonwildlife oriented recreation, and law enforcement.  The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, equipment utilization and replacement, communications systems, computer
    systems, and other.  Items of interest are provided at the end.",nt"license_title":
